import React from 'react'
import {IoLogoPinterest} from "react-icons/io";

const _stylesNavLeft = {
    iconPinterest:{
        width: '35px',
        height: '35px',

        color: 'red',
        cursor: 'pointer',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
    };
function PinIconNavLeft() {
    return (
        <div style={_stylesNavLeft.iconPinterest}>
            <IoLogoPinterest/>
        </div>
    )
}

export default PinIconNavLeft;
